 @clemandax9242  with how short people's attention span is, I'd say anything released more than two years ago is retro. But that's too short of a period.
Seriously. People forget gems almost as soon as they come on. And once I see a game in giveaways I notice it is rarely a good, and recent, game.
The only things that go straight to the discount bin are old, indie, or bad games.
